import React from 'react';
import { createMuiTheme, makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import KeyboardArrowRightIcon from '@material-ui/icons/KeyboardArrowRight';
import history from '../../../../history';

const useStyles = makeStyles((theme) => ({
    root: {
        primary: {
          light: '#DAAD86',
          main: '#659DBD',
          dark: '#8D8741',
          contrastText: '#fff',
        },
        '& > *': {
            margin: theme.spacing(1),
            fontFamily: 'NanumPen',
            fontSize: '150%',
        },
    },
}));

const theme = createMuiTheme({
  palette: {
    primary: {
      light: '#DAAD86',
      main: '#659DBD',
      dark: '#8D8741',
      contrastText: '#fff',
    },
    secondary: {
      light: '#ff7961',
      main: '#f44336',
      dark: '#ba000d',
      contrastText: '#000',
    },
  },
});


export default function ContainedButtons() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Button variant="outlined" color="primary" size="large" onClick={() => history.push('/Profile')}>Profile</Button>
            <Button variant="contained" color="primary" size="large" onClick={() => history.push('/Portfolio')} endIcon={<KeyboardArrowRightIcon />}>Portfolio</Button>
        </div>
    );
}
